import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import Card from './Card'
import * as serviceWorker from './serviceWorker';
import 'tachyons';
import {robots} from './robots.js'

ReactDOM.render(
  <div>
    <Card id={robots[0].id} name={name[0].id} email={email[0].id}/>
    <Card id={robots[1].id} name={name[1].id} email={email[1].id}/> 
    <Card id={robots[2].id} name={name[2].id} email={email[2].id}/> 
    <Card id={robots[3].id} name={name[3].id} email={email[3].id}/>
  </div>
  , document.getElementById('root')
);

// If you want your app to work offline and load faster, you can change
// unregister() to register() below. Note this comes with some pitfalls.
// Learn more about service workers: https://bit.ly/CRA-PWA
serviceWorker.unregister();
